import React from "react";
import {LINKS_NAV} from "../config/config_nav";
import {NavLink} from "react-router-dom";

const Navigation = () => {

    const itemNavigation = LINKS_NAV.map(link => {
        return <div className="nav__item">
            <NavLink key={link.path} className="nav__link" to={link.path}>
                <span className="nav__link-title">{link.label}</span>
            </NavLink>
            <div className="nav__link-strip"></div>
        </div>
    })
    return <React.Fragment>
        <div className="nav">
                {itemNavigation}
        </div>
    </React.Fragment>
}
export default Navigation;
